utton to see meter details\n    And check tariff \"<tariff>\" text\n    And check tariff value \"<tariffvalue>\" text\n    And Check meter waiting \"<waitlabel>\" text\n    And check meter waiting value\n    And Check meter extra \"<extra>\" text\n    And check meter extra value\n    And Check meter discount percentage \"<discountper>\" text\n    And check meter discount percentage value\n    And Check stop waiting \"<stopwaiting>\" text\n    And click on Stop waiting button\n    And Check Start waiting \"<startwaiting>\" text\n    And click on Start waiting button again\n    And Verify customer image on Waiting screen\n    And verify customer name on Waiting screen\n    And Verify Send SMS Ring back button icon\n    And getting late icon on Waiting screen\n    And message chat icon on Waiting screen\n    And click again on Meter expand button to close meter details on waiting screen\n    Then Meter UI texts and buttons clicks are verified\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting  | startwaiting  |\n      | Distance | Waiting | Tariff | T1          | Waiting   | Extra | Discount Percentage | Start Waiting | Stop Waiting |\n\n  @Onboarding\n  Scenario Outline: Waiting Screens UI and buttons clicks verifications\n    When Driver is on Waiting Screen and lets verify Waiting screens UI and texts fields\n    And move scroll up so that pick and drop address and screen UI are visible on waiting screen\n    And verify waiting screen re route icon\n    And verify waiting screen current location icon\n    And verify waiting screen start navigation icon\n    And verify waiting screen pickup whole box\n    And verify waiting screen dropoff whole box\n    And Check waiting screen pickup zone text\n    And Check waiting screen pickup address text\n    And check waiting screen dropoff zone text\n    And check waiting screen dropoff Address text\n    And check waiting screen jobtype text\n    And ch omplete Testing\n\n  @OnboardingVerification\n  Scenario Outline: Meter UI and button clicks verifications on POB Screen\n    Given Meter Alerts comes as Driver move to the POB screen\n    When Verify Cost value and text on POB screen\n    And check distance \"<distance>\" text on POB screen\n    And check to verify miles covered values and text on POB screen\n    And Check Progress loader icon on POB screen\n    And check pob lable \"<waiting>\" text\n    And Check pob time value\n    And click on Meter expand button on pob to see meter details\n    And check tariff \"<tariff>\" text on POB screen\n    And check pob screen tariff value \"<tariffvalue>\" text\n    And Check meter pob \"<waitlabel>\" text\n    And check meter pob value\n    And Check meter extra \"<extra>\" text on pob screen\n    And check meter extra value on pob\n    And Check meter discount percentage \"<discountper>\" text on pob screen\n    And check meter discount percentage value on pob screen\n    And Check stop waiting \"<stopwaiting>\" text on pob screen\n    And click on Stop waiting button on pob screen\n    And Check Start waiting \"<startwaiting>\" text on pob screen\n    And click on Start waiting button again on pob screen\n    And Check to verify stop meter \"<stopmeter>\" text on pob screen\n    And click on Stop meter button on pob screen\n    And check to verify Start meter \"<startmeter>\" text on pob screen\n    And click on Start meter button on pob screen\n    And check to verify Add extra charges \"<addextracharges>\" on pob screen\n    And Verify customer image on pob screen\n    And verify customer name on pob screen\n    And message chat icon on pob screen\n    And click again on Meter expand button to close meter details on pob screen\n    Then Meter UI texts and buttons clicks are verified on pob screen\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting  | startwaiting  | stopmeter  | startmeter  | addextracharges   |\n      | Distance | Waiting | Tariff | T1          | Waiting   | Extra | Discount Percentage | Stop Waiting | Stop Waiting | Stop Meter | Start Meter | Add extra charges |\n\n  @OnboardingVerification\n  Scenario Outline: POB Screens UI and buttons clicks verifications\n    When Driver is on POB Screen and lets verify Waiting screens UI and texts fields\n    And move scroll up so that pick and drop address and screen UI are visible on pob screen\n    And verify pob screen current location icon\n    And verify pob screen start navigation icon\n    And verify pob screen pickup whole box\n    And verify pob screen dropoff whole box\n    And Check pob screen pickup zone text\n    And Check pob screen pickup address text\n    And check pob screen dropoff zone text\n    And check pob screen dropoff Address text\n    And check change dropoff address \"<dropoffaddress>\" text on pob screen\n    And check pob screen jobtype text\n    And check pob screen payment text\n    And check pob screen Booking text\n    And check pob screen tariff text\n    And check pob screen driver notes text\n    And check stc button \"<stc>\" text\n    And move scroll down so that pick and drop address and screen UI are not visible on pob screen\n    Then POB Job screen UI elements are verified\n\n    Examples: \n      | stc   | dropoffaddress |\n      | S.T.C | Change         |\n\n  @Onboarding\n  Scenario Outline: To Move job to the STC status as driver tab on stc button when driver is on board\n    When Driver Click on stc button\n    Then Job Status become STC\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/09_JobPOB_Screen.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"POB Screen UI verification and Complete Testing","description":"","children":[{"scenario":{"location":{"line":4, ried":false}},{"source":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/15_DriverMessages.feature","data":"Feature: Verify Drivers Messages Alert functionality on All Job Status\n\n  @OnboardingDriversMessages\n  Scenario Outline: Job creation from Evop for Drivers messages verification on All Job Status\n    Given Job request are given for Drivers Messages alert verification\n    When Job request are send to the server for Drivers messages verification\n    Then new job has been created in order to check and verify Drivers Messages in throughout job status\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Accepted screen\n    Given Job has been received on DM8 and Accept it for Drivers Messages verifications\n    When click on message icon chat button on Accepted screen\n    And check Message whole alerts on Accepted screen\n    And check alerttitle \"<msg>\" text on Accepted screen\n    And click message chat icon button for second time on Accepted screen\n    And chech to verify message area on Accepted screen\n    And check to verify cancle \"<cnle>\" button text Accepted screen\n    And check to verify send \"<send>\" button text on Accepted screen\n    And click message chat icon to send message on Accepted screen\n    And click on message button on Accepted screen\n    And click on send button button on Accepted screen\n    And click on move job to waiting status for Chat message verification\n    Then All UI and text are verified on Accepted screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Waiting screen\n    Given Job are in waiting status\n    When click on message icon chat button on Waiting screen\n    And check Message whole alerts on Waiting screen\n    And check alerttitle \"<msg>\" text on Waiting screen\n    And click message chat icon button for second time on Waiting screen\n    And chech to verify message area on Waiting screen\n    And check to verify cancle \"<cnle>\" button text Waiting screen\n    And check to verify send \"<send>\" button text on Waiting screen\n    And click message chat icon to send message on Waiting screen\n    And click on message button on Waiting screen\n    And click on send button button on Waiting screen\n    And click on move job to pob status for Chat message verification\n    Then All UI and text are verified on Waiting screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on POB screen\n    Given Job are in pob status\n    When click on message icon chat button on POB screen\n    And check Message whole alerts on POB screen\n    And check alerttitle \"<msg>\" text on POB screen\n    And click message chat icon button for second time on POB screen\n    And chech to verify message area on POB screen\n    And check to verify cancle \"<cnle>\" button text POB screen\n    And check to verify send \"<send>\" button text on POB screen\n    And click message chat icon to send message on POB screen\n    And click on message button on POB screen\n    And click on send button button on POB screen\n    And click on move job to stc status for Chat message verification\n    Then All UI and text are verified on POB screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on STC screen\n    Given Job are in stc status\n    When click on message icon chat button on STC screen\n    And check Message whole alerts on STC screen\n    And check alerttitle \"<msg>\" text on STC screen\n    And click message chat icon button for second time on STC screen\n    And chech to verify message area on STC screen\n    And check to verify cancle \"<cnle>\" button text STC screen\n    And check to verify send \"<send>\" button text on STC screen\n    And click message chat icon to send message on STC screen\n    And click on message button on STC screen\n    And click on send button button on STC screen\n    And click on move job to clear status for Chat message verification\n    Then All UI and text are verified on STC screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  #@OnboardingDriversMessages\n  #Scenario Outline: Drivers Messages verification on Clear screen\n    #Given Job are in clear status\n    #When click on message icon chat button on Clear screen\n    #And check Message whole alerts on Clear screen\n    #And check alerttitle \"<msg>\" text on Clear screen\n    #And click message chat icon button for second time on Clear screen\n    #And chech to verify message area on Clear screen\n    #And check to verify cancle \"<cnle>\" button text Clear screen\n    #And check to verify send \"<send>\" button text on Clear screen\n    #And click message chat icon to send message on Clear screen\n    #And click on message button on Clear screen\n    #And click on send button button on Clear screen\n    #And click on move job to Feedback status for Chat message verification\n    #Then All UI and text are verified on Clear screen\n\n    #Examples: \n     # | msg      | cnle   | send |\n      #| Messages | CANCEL | SEND |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/15_DriverMessages.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Verify Drivers Messages Alert functionality on All Job Status","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingDriversMessages","id":"faa
